import UserList from './users/UserList';

function App() {


  return (
    <div className="container">
      <div className="header">React app</div>
      <nav className="menu">
        <ul>
          <li>Home</li>
          <li>Users</li>
        </ul>
      </nav>
      <div className="content"><UserList /></div>
    </div>
  );
}

export default App;
